-- drop tables
DROP TABLE IF EXISTS payments;
DROP TABLE IF EXISTS invoices;
DROP TABLE IF EXISTS details;
DROP TABLE IF EXISTS orders;
DROP TABLE IF EXISTS products;
DROP TABLE IF EXISTS customers;

CREATE TABLE Customers (
    custid   INTEGER PRIMARY KEY,
    cname    VARCHAR(14),
    country  CHAR(3)
);

CREATE TABLE Products (
    pcode    INTEGER PRIMARY KEY,
    pname    VARCHAR(10),
    pdesc    VARCHAR(20),
    ptype    VARCHAR(20),
    price    NUMERIC(6,2)
    CHECK ( price > 0 )
);

CREATE TABLE Orders (
    ordid    INTEGER PRIMARY KEY,
    odate    DATE,
    ocust    INTEGER NOT NULL REFERENCES Customers
);

CREATE TABLE Details (
    ordid    INTEGER REFERENCES Orders,
    pcode    INTEGER REFERENCES Products,
    qty      SMALLINT,
    PRIMARY KEY (ordid, pcode)
);

CREATE TABLE Invoices (
    invid    SERIAL PRIMARY KEY,
    ordid    INTEGER NOT NULL UNIQUE REFERENCES Orders,
    amount   NUMERIC(8,2) CHECK ( amount > 0 ),
    issued   DATE,
    due      DATE,
    CHECK ( due >= issued )
);

CREATE TABLE Payments (
    payid    INTEGER PRIMARY KEY,
    tstamp   TIMESTAMP,
    amount   NUMERIC(8,2) CHECK ( amount > 0 ),
    invid    INTEGER NOT NULL REFERENCES Invoices
);
